import React, { useContext,useState } from 'react'
import {BarangContext} from './context/BarangContext'
import { CartProvider } from './context/CartContext';

import NavHeader from './NavHeader';
import Barang from './Barang';
import AddBarang from './AddBarang';
import ListCart from './Cart';


const ListBarang = () => {
    const [barang,setBarang]=useState ([
        { 
          id: 1001,
          nama: 'Tepung Kanji',
          harga: 50000,
          stok: 10,
          count: 0,
          tglMasuk: '10/01/2021',
          tglKeluar: '15/01/2021',
        },
        { 
          id: 1002,
          nama: 'Tepung Maizena',
          harga: 50000,
          stok: 3,
          count: 0,
          tglMasuk: '10/01/2021',
          tglKeluar: '15/01/2021',
        },
    ]);

    return (
        <div>
            <NavHeader />
            <AddBarang />
            {barang.map((barang,index) => (
                <Barang key = {index}
                        id={barang.id}
                        tglMasuk = {barang.tglMasuk}
                        tglKeluar={barang.tglKeluar}
                        nama={barang.nama} 
                        harga={barang.harga}
                        stok={barang.stok}
                        counter={barang.count}
            /> 
            ))}
        </div>
    )
}

export default ListBarang
